import './styles.scss';

//MaterialUI
import ContactlessIcon from '@material-ui/icons/Contactless';

export default function Header() {
    return (
        <div className="header">
            <div className="left">
                <h1>Invoices</h1>
            </div>
            <div className="right">
                <ContactlessIcon/>
            </div>
        </div>
    )
}
